import React, { Component } from 'react';
import { observer, inject } from 'mobx-react';
import jsPDF from 'jspdf';
@inject('store')
@observer
class Cart extends Component {
    constructor(props) {
        super(props)
      };
     
      generatePdf = () => {
     
        var doc = new jsPDF('p', 'pt');
        var image = new Image();
        image.src = 'data:image/png;base64,';
        doc.text(20, 40, '#invoice 1452784')
        doc.addImage(image, 'PNG', 400, 20, 50, 50); //base64 image, format, x-coordinate, y-coordinate, width, height
       
        doc.text(20, 60, 'Date: Enter Invoice Date')
        doc.text(20, 100, 'Bill To')
        doc.text(20, 120, 'Name | Company')
        doc.text(400, 100, 'For')
        doc.text(400, 120, 'Product Description')
        doc.text('Item Description', 200, 200);
        doc.text(20, 220, 'product1')
        doc.text(400, 220, '200')
        doc.text(20, 240, 'product 2')
        doc.text(400, 240, '200')
        doc.text(20, 300, ' total:')
        doc.text(400, 300, '400')

        doc.text(20, 500, 'If you have any questions concerning this invoice')
        doc.text(20, 520, ' use the following contact information:')
        
        doc.save('sample-file.pdf')
      }
      
    render() {
        return (
            <div className='card'>
                <div>
                    <p>Items added to Cart will be displayed here</p>
                </div>
                <div className={'row'}>
                    {this.props.store.currentCart.map((data, index) => (
                        <div key={index} className='cart col-md-3'>
                            <img height={30} src={data.image} alt='Product stuff' />
                            <div className='product-cart-name'>{data.name}</div>
                            <div className='control'>
                          <span
                              onClick={() => this.props.store.removeFromCart(data.product_id)}
                              className='btn btn-danger btn-xs cancel'
                          >
                          <i className={'fa fa-times'} />
                      </span>
                                <span
                                    onClick={() =>
                                        this.props.store.increaseQuantityInCart(data.product_id)
                                    }
                                    className='btn btn-success btn-xs'
                                >
                              <i className={'fa fa-plus'} />
                          </span>
                                <span
                                    onClick={() =>
                                        this.props.store.decreaseQuantityInCart(data.product_id)
                                    }
                                    className='btn btn-warning btn-xs'
                                >
                              <i className={'fa fa-minus'} />
                          </span>
                            </div>
                            <div className='quantity'>{data.quantity}</div>
                            <div className='quantity'>$ {data.price}</div>
                        </div>
                    ))}
                </div>
                <div>
        <button onClick={this.generatePdf()} type="primary">Download PDF</button>
      </div>
            </div>

            
        );
    }
}
export default observer(Cart);